// Enums.js

export const Sprache = Object.freeze({
    DEUTSCH: 'Deutsch',
    ENGLISH: 'English',
    ZWEISPRACHIG: 'Zweisprachig'
});

export const Anrede = Object.freeze({
    FRAU: 'Frau',
    HERR: 'Herr',
    DIVERSE: 'Diverse'
});

export const Land = Object.freeze({
    OESTERREICH: 'Österreich',
    DEUTSCHLAND: 'Deutschland',
    SCHWEIZ: 'Schweiz'
});

export const Waehrung = Object.freeze({
    EUR: 'EUR',
    USD: 'USD',
    GBP: 'GBP',
    CHF: 'CHF'
});

// ... other enums
